    // Жат кирлл әріптерін төл кирлларыпыне айналдыру
    public static func copycatCyrlToOriginalCyrl(cyrlText: String) -> String {
        return String(cyrlText)
            .replacingOccurrences(of: "Ə", with: "Ә")
            .replacingOccurrences(of: "ə", with: "ә")
            .replacingOccurrences(of: "Ɵ", with: "Ө")
            .replacingOccurrences(of: "ɵ", with: "ө")
    }
    
    // Кирілді латынға айналдыру
    public static func cyrl2Latyn(cyrlText: String) -> String {
        //updateWordsPack(convertType: "cyrl2latyn")
        var cyrlText = copycatCyrlToOriginalCyrl(cyrlText: cyrlText)
        cyrlText += "."
        let charsArray = Array(cyrlText)
        var chars = Array<String>(repeating: "", count: charsArray.count)
        for i in 0 ..< charsArray.count {
            chars[i] = String(charsArray[i])
        }
        let length = chars.count
        var latynStrs = Array<String>(repeating: "", count: length)
        var prevSound = Sound.Unknown
        var cyrlWord = ""
        var i = -1
        for index in 0 ..< length {
            if( index <= i ) {continue}
            else { i = index }
            if !(cyrlChars.contains(chars[i].uppercased()))
            {
                if !(cyrlWord.isEmpty)
                {
                    let wordLength = cyrlWord.count
                    var k = wordLength
                    var j = (i - wordLength)
                    while ((3 < k) || (wordLength == 3 && k >= 3) || (wordLength == 2 && k >= 2)) {
                        let wpKey = cyrlWord[0 ..< k].lowercased()
                        if (QazLatynHelper.wordsPackDic[wpKey] != nil)
                        {
                            latynStrs[j] = convertWord(oldValue: cyrlWord[0 ..< k], newValue: wordsPackDic[wpKey]!)
                            j += k
                            break
                        }
                        k -= 1
                    }
                    cyrlWord = cyrlWord.lowercased()
                    var lastIsUpper = false
                    var prevIsC = false
                    let lastStartIndex = j
                    j = j - 1
                    for item in j + 1 ..< i {
                        if( item <= j ) {continue}
                        else { j = item }
                        if (j > lastStartIndex) {
                            prevSound = vowelChars.contains(chars[j - 1].uppercased()) ? Sound.Vowel : Sound.Consonant
                            prevIsC = chars[j - 1].lowercased() == "с"
                        }
                        if (j != length - 1 && cyrlChars.contains(chars[j + 1].uppercased()) && chars[j + 1] == chars[j + 1].uppercased()) {
                            lastIsUpper = true
                        }
                        if (wordLength > 3) {
                            let key = chars[i - 3] + chars[i - 2] + chars[i - 1]
                            switch (key.lowercased())
                            {
                            case "сть":  chars[i] = ""; chars[i - 1] = ""
                            default: break
                            }
                        }
                        
                        if (j + 1 < length) {
                            let key = chars[j] + chars[j + 1]
                            switch (key.lowercased())
                            {
                            case "ия": latynStrs[j] = convertWord(oldValue: key, newValue: "ıa"); j += 1; continue
                            case "йя": latynStrs[j] = convertWord(oldValue: key, newValue: "ııa"); j += 1; continue
                            case "ию": latynStrs[j] = convertWord(oldValue: key, newValue: "ıý"); j += 1; continue
                            case "йю": latynStrs[j] = convertWord(oldValue: key, newValue: "ıý"); j += 1; continue
                            case "сц": latynStrs[j] = convertWord(oldValue: key, newValue: "s"); j += 1; continue
                            case "тч": latynStrs[j] = convertWord(oldValue: key, newValue: "ch"); j += 1; continue
                            case "ий": latynStrs[j] = convertWord(oldValue: key, newValue: "ı"); j += 1; continue
                            case "ХХ": latynStrs[j] = "ХХ"; j += 1; continue
                            default  : break
                            }
                        }
                        
                        switch (chars[j])
                        {
                        case "Я":  latynStrs[j] = prevSound == Sound.Consonant ? "Á" : "Ia"
                        case "я":  latynStrs[j] = prevSound == Sound.Consonant ? "á" : "ıa"
                        case "Ю":  latynStrs[j] = prevSound == Sound.Consonant ? "Ú" : "Iý"
                        case "ю":  latynStrs[j] = prevSound == Sound.Consonant ? "ú" : "ıý"
                        case "Щ":  latynStrs[j] = lastIsUpper ? "SH" : "Sh"
                        case "щ":  latynStrs[j] = "sh"
                        case "Э":  latynStrs[j] = "E"
