    // Сөздің бірінші әрпін үлкенге айналдыру
    private static func firstCharToUpper(input:String) -> String {
        if (input.isEmpty) {
            return input
        }
        
        return qazLatynToUpper(latynText: String(input[0..<1])) + String(input[1 ..< input.count])
    }
    
    // Қазақ латын әріптерін кіші әріпке айналдыру
    private static func qazLatynToLower(latynText: String) -> String {
        return latynText.replacingOccurrences(of: "I", with: "ı").replacingOccurrences(of: "İ", with: "i").lowercased()
    }
    
    // Қазақ латын әріптерін үлкен әріпке айналдыру
    private static func qazLatynToUpper(latynText:String) -> String {
        return latynText.replacingOccurrences(of: "ı", with: "I").replacingOccurrences(of: "i", with: "İ").uppercased()
    }
    
    // Сөздерді үлкен-кіші жазылуына қарай сәйкестендіру
    private static func convertWord(oldValue: String, newValue: String) -> String {
        if (oldValue.isEmpty) {
            return ""
        }
        
        return oldValue.isEqual(qazLatynToUpper(latynText: oldValue)) ? qazLatynToUpper(latynText: newValue):
            oldValue.isEqual(firstCharToUpper(input: oldValue)) ? firstCharToUpper(input: newValue) : qazLatynToLower(latynText: newValue)
    }
    
